"use strict";angular.module("DnDManagerApp").controller("dataCtrl",["$scope","$http",function(a,b){b.get("http://localhost:3000/entities").then(function(b){a.entities=b.data}),a.refreshGrid=function(c){a.currentEntity=c,b.get("http://localhost:3000/"+c).then(function(b){a.gridData=b.data})},a.edit=function(b){a.editing=!0},a.delete=function(c){b.delete("http://localhost:3000/"+a.currentEntity+"/"+c.id)}}]);